SELECT TIME_SLICE(timestamp, 21600, 'SECOND', 'START') AS period, count(*) FROM pypi WHERE (project = 'pynacl') AND (timestamp >= DATEADD(days, -42, '2023-06-23 08:33:59'::DateTime)) AND timestamp <= DATEADD(days, -17, '2023-06-23 08:33:59'::DateTime) GROUP BY period ORDER BY period ASC;
SELECT DATE_TRUNC('DAY',timestamp) AS day, count(*) AS count FROM pypi WHERE (project = 'google-cloud-storage') AND (timestamp > DATEADD(days, -90, '2023-06-23'::Date)) GROUP BY day ORDER BY day ASC;
SELECT TIME_SLICE(timestamp, 18144, 'SECOND', 'START') AS period, count(*) FROM pypi WHERE (project = 'google-cloud-storage') AND (timestamp >= DATEADD(days, -44, '2023-06-23 08:33:59'::DateTime)) AND timestamp <= DATEADD(days, -23, '2023-06-23 08:33:59'::DateTime) GROUP BY period ORDER BY period ASC;
